// src/MandateAccessButton.js

import React from 'react';
import axios from 'axios';

const MandateAccessButton = () => {
  const fetchData = async () => {
    try {
      const response = await axios.get('https://localhost:3003/0');
      console.log('Data fetched:', response.data);
      // You can add additional logic to handle the response data
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  return (
    <button onClick={fetchData}>
      Generate Mandate Access
    </button>
  );
};

export default MandateAccessButton;
